--
-- Definition of procedure `AccessCode`
--

DROP PROCEDURE IF EXISTS `AccessCode`;

DELIMITER $$

/*!50003 SET @TEMP_SQL_MODE=@@SQL_MODE, SQL_MODE='NO_AUTO_VALUE_ON_ZERO' */ $$
CREATE DEFINER=`root`@`localhost` PROCEDURE `AccessCode`(RegNo CHAR(20), Agent CHAR(20))
BEGIN

  DECLARE RandomizedNo BIGINT;
  DECLARE HandleVoteCode BIGINT;
  DECLARE StudentAvailability CHAR(1);


  IF EXISTS(SELECT * FROM voteStudents WHERE stud_Reg_no = RegNo) THEN
    SET StudentAvailability = '0';

    SELECT VoteCode INTO HandleVoteCode FROM VoteStudents WHERE stud_reg_no = RegNo;

    IF HandleVoteCode IS NOT NULL THEN
      SET RandomizedNo = HandleVoteCode;
    ELSE
      increment: LOOP

        SELECT (FLOOR(RAND() * 6000000000) + 1000000000) INTO RandomizedNo;

        IF EXISTS(SELECT * FROM VoteStudents WHERE VoteCode = RandomizedNo) THEN
           ITERATE increment;
        ELSE
           UPDATE votestudents
             SET VoteCode = RandomizedNo,
                 HasGotCode = 1,
                 TimeGotCode = NOW(),
                 AgentName = Agent
           WHERE stud_reg_no = RegNo;
           LEAVE increment;
        END IF;

      END LOOP increment;
    END IF;

    SELECT stud_reg_no, stud_name, RandomizedNo, StudentAvailability FROM voteStudents WHERE stud_Reg_no = RegNo;
  ELSE
    SET StudentAvailability = '1';
    SELECT StudentAvailability ;
  END IF;
END $$
/*!50003 SET SESSION SQL_MODE=@TEMP_SQL_MODE */  $$

DELIMITER ;

--
-- Definition of procedure `Summary`
--

DROP PROCEDURE IF EXISTS `Summary`;

DELIMITER $$

/*!50003 SET @TEMP_SQL_MODE=@@SQL_MODE, SQL_MODE='STRICT_TRANS_TABLES,NO_AUTO_CREATE_USER,NO_ENGINE_SUBSTITUTION' */ $$
CREATE DEFINER=`root`@`localhost` PROCEDURE `Summary`()
BEGIN

    DECLARE REGVOTERS_MALE              INTEGER DEFAULT 0;
    DECLARE REGVOTERS_FEMALE            INTEGER DEFAULT 0;
    DECLARE VOTERS_TURNED_MALE          INTEGER DEFAULT 0;
    DECLARE VOTERS_TURNED_FEMALE        INTEGER DEFAULT 0;
    DECLARE VOTERS_TURNED_MALE_NOT      INTEGER DEFAULT 0;
    DECLARE VOTERS_TURNED_FEMALE_NOT    INTEGER DEFAULT 0;
    DECLARE GC_NOT_CASTED_MALE          INTEGER DEFAULT 0;
    DECLARE GC_NOT_CASTED_FEMALE        INTEGER DEFAULT 0;
    DECLARE AB_NOT_CASTED_MALE          INTEGER DEFAULT 0;
    DECLARE AB_NOT_CASTED_FEMALE        INTEGER DEFAULT 0;
    DECLARE VOTED_FULL_MALE             INTEGER DEFAULT 0;
    DECLARE VOTED_FULL_FEMALE           INTEGER DEFAULT 0;
    DECLARE PERCENT                     DOUBLE(8, 2) DEFAULT 0;
    DECLARE TV                          BIGINT DEFAULT 0;

    DELETE FROM Casts WHERE stud_reg_no = '';

    SELECT COUNT(*) INTO REGVOTERS_MALE FROM votestudents WHERE stud_sex = 'MALE';
    SELECT COUNT(*) INTO REGVOTERS_FEMALE FROM votestudents WHERE stud_sex = 'FEMALE';
    
    SELECT COUNT(*) INTO VOTERS_TURNED_MALE FROM votestudents WHERE stud_sex = 'MALE' AND HasGotCode = 1;
    SELECT COUNT(*) INTO VOTERS_TURNED_FEMALE FROM votestudents WHERE stud_sex = 'FEMALE' AND HasGotCode = 1;
    
    SELECT COUNT(*) INTO VOTERS_TURNED_MALE_NOT FROM votestudents WHERE stud_sex = 'MALE' AND HasGotCode = 0;
    SELECT COUNT(*) INTO VOTERS_TURNED_FEMALE_NOT FROM votestudents WHERE stud_sex = 'FEMALE' AND HasGotCode = 0;

    SELECT COUNT(*) INTO GC_NOT_CASTED_MALE FROM votestudents WHERE stud_sex = 'MALE' AND HasGotCode = 1 AND HasVoted = 0;
    SELECT COUNT(*) INTO GC_NOT_CASTED_FEMALE FROM votestudents WHERE stud_sex = 'FEMALE' AND HasGotCode = 1 AND HasVoted = 0;
    
    
    SELECT COUNT(*) INTO AB_NOT_CASTED_MALE FROM votestudents WHERE stud_sex = 'MALE' AND AccessedBallotPaper = 1 AND HasVoted = 0;
    SELECT COUNT(*) INTO AB_NOT_CASTED_FEMALE FROM votestudents WHERE stud_sex = 'FEMALE' AND AccessedBallotPaper = 1 AND HasVoted = 0;

    SELECT COUNT(*) INTO VOTED_FULL_MALE FROM votestudents WHERE stud_sex = 'MALE' AND HasVoted = 1;
    SELECT COUNT(*) INTO VOTED_FULL_FEMALE FROM votestudents WHERE stud_sex = 'FEMALE' AND HasVoted = 1;
    
    SET PERCENT = ROUND(((VOTED_FULL_MALE + VOTED_FULL_FEMALE) / (REGVOTERS_MALE + REGVOTERS_FEMALE)) * 100, 2);
    
    SELECT COUNT(DISTINCT(stud_reg_no)) INTO TV FROM casts;
    
    SELECT 
        REGVOTERS_MALE, REGVOTERS_FEMALE, 
        VOTERS_TURNED_MALE, VOTERS_TURNED_FEMALE, 
        VOTERS_TURNED_MALE_NOT, VOTERS_TURNED_FEMALE_NOT, 
        GC_NOT_CASTED_MALE, GC_NOT_CASTED_FEMALE,
        AB_NOT_CASTED_MALE, AB_NOT_CASTED_FEMALE,
        VOTED_FULL_MALE, VOTED_FULL_FEMALE, PERCENT, TV FROM DUAL;
END $$
/*!50003 SET SESSION SQL_MODE=@TEMP_SQL_MODE */  $$

